script: |
  super -f text -I q10584.spq | sort > q10584.out

inputs:
  - name: q10584.spq
    data: |
      SELECT DISTINCT col2 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT col2 + - - col1 + 97 * 75 IN ( - + 21 + - col2 * 21 + col2, + col0 );
  - name: tab1

outputs:
  - name: q10584.out
    data: |
      59
      68
      96
